<div id="kettle" class="spec_area">
<div class="spec_title">
<p>機能項目</p>
</div>
<table cellpadding="0" cellspacing="0">
<tr>
<th>機種名</th>
<td>PRT-A100W</td>
</tr>
<tr>
<th>色柄</th>
<td>（W）ホワイト</td>
</tr>
<tr>
<th>本体サイズ（約）（幅×奥行き×高さ）</th>
<td>14.5×19.9×25.9cm</td>
</tr>
<tr>
<th>本体質量（約）</th>
<td>0.9kg</td>
</tr>
<tr>
<th>容量</th>
<td>1.02L</td>
</tr>
<tr>
<th>保温効力<span style="font-size:10px; color:#FA002D;">（※1）</span></th>
<td>10時間：66度以上<br>24時間：50度以上</td>
</tr>
<tr>
<th>保冷効力<span style="font-size:10px; color:#FA002D;">（※2）</span></th>
<td>10時間：8度以下</td>
</tr>
</table>

<p class="comment_area">※1 保温効力とは、室温20度±2度において製品に熱湯を満たし、湯温が95度±1度の時から24時間及び10時間放置した場合におけるその湯の温度です。</p>
<p class="comment_area">※2 保冷効力とは、室温20度±2度において製品に冷水を満たし、水温が4度±1度の時から10時間放置した場合におけるその水の温度です。</p>
</div>
